pragma solidity ^0.8.0;

contract UpgradeableProxy {
    address private admin;
    address private implementation;

    event Upgraded(address indexed newImplementation);

    function upgradeTo(address newImplementation) public {
        require(newImplementation != address(0), "ERC1967: new implementation is not a contract");
        require(msg.sender == admin, "TransparentUpgradeableProxy: caller is not admin");

        // Ensure the new implementation is a contract
        require(newImplementation.code.length > 0, "ERC1967: new implementation is not a contract");

        // Update the implementation address
        implementation = newImplementation;

        // Emit the upgrade event
        emit Upgraded(newImplementation);

        // Perform a delegatecall to the new implementation to verify compatibility
        (bool success, bytes memory returnData) = newImplementation.delegatecall(abi.encodeWithSignature("initialize()"));
        require(success, "Address: delegate call to non-contract");
        require(returnData.length == 0, "Address: delegate call returned unexpected data");
    }
}

